  const [darkTheme, setDarkTheme] = useState(false);
  return (
    <div className={darkTheme ? 'dark' : ''}>
      <div className='bg-black'>
        <h1 className='text-3xl font-bold underline'>App</h1>
      </div>
    </div>
  );
};

export default App;
